import React from 'react';
import logo from './logo.svg';
import './App.css';

const welcome = {
  greeting: "Hey",
  title: "React"
}

const list = [
  {
    title: "React",
    url: "https://reactjs.org/",
    author: "Jordan Walke",
    num_comments: 3,
    points: 4,
    objectID: 0
  }, 
  {
    title: "Redux",
    url: "https://redux.js.org/",
    author: 'Dan Abramov, Andrew Clark',
    num_comments: 2,
    points: 5,
    objectID: 1
  }
]

function App() {
  const title = 'React'
  return (
    <div>
      <h1>
        My hacker stories
      </h1>

      <label htmlFor="search">search: </label>
      <input id="search" type="text"/>

      <hr/>
      {list.map(item => <li>item</li>)}
    </div>
  );
}

export default App;
